const morseCodeDiv = document.getElementById('morseCode')
morseCodeDiv.textContent = morseCodeString

let isSlowingDown = false
function slowDownAnimation() {
    if(!isSlowingDown) return

    let currentDuration = parseFloat(getComputedStyle(morseCodeDiv).animationDuration)
    if (currentDuration < 10000) {
        currentDuration += 1
        morseCodeDiv.style.animationDuration = currentDuration + 's';
        requestAnimationFrame(slowDownAnimation)
    }
}

morseCodeDiv.addEventListener('click', () => {
    isSlowingDown = true
    slowDownAnimation()
})
